pub fn default_abi() -> u32 {
    unsafe { asm!("", options(noreturn)); }
}

#[naked]
pub extern "Rust" fn rust_abi() -> u32 {
    unsafe { asm!("", options(noreturn)); }
}
```

{{produces}}

### Explanation

The Rust ABI is currently undefined. Therefore, naked functions should
specify a non-Rust ABI.

