The `late_bound_lifetime_arguments` lint detects generic lifetime
arguments in path segments with late bound lifetime parameters.

### Example

```rust
struct S;

impl S {
    fn late<'a, 'b>(self, _: &'a u8, _: &'b u8) {}
}

fn main() {
    S.late::<'static>(&0, &0);
}
```

{{produces}}

### Explanation

